      wireObj.kind.ChannelPending.user_channel_id = pre_user_channel_id;
      wireObj.kind.ChannelPending.former_temporary_channel_id =
          pre_former_temporary_channel_id;
      wireObj.kind.ChannelPending.counterparty_node_id =
